import React, {useState} from 'react';
import Dialog from '@mui/material/Dialog';
import DialogContent from '@mui/material/DialogContent';
import "./Order.css"
import { Link } from 'react-router-dom';
import PhoneInput, { isValidPhoneNumber } from 'react-phone-number-input';
import CloseIcon from '@mui/icons-material/Close';

const Order = () => {
    const [open, setOpen] = useState(true);
    const [phone, setPhone] = useState()
    const [data, setData] = useState({
        name: "", 
        surname: "", 
        email: "", 
        country: "", 
        city: "", 
    })
    // const [name, setName] = useState("")
    // const [surname, setSurname] = useState("")
    // const [email, setEmail] = useState("")
    // const [country, setCountry] = useState("")
    // const [city, setCity] = useState("")
    const [checked, setChecked] = useState(false)
    const [button, setButton] = useState(false)

    const handleInputChange = (e) => {
    setData({
      ...data,
      [e.target.name]: e.target.value,
    });
  };
    if (name || surname || email || country || city || checked || phone) {
        setButton(true)
    }
    function save() {
        if (
            !name || 
            !surname ||
            !email ||
            !country ||
            !city ||
            !checked
        ) {
            alert("Please, fill in")
            return
        } 
        setOpen(false)
    }

    function value(e) {
        let checked = e.target.checked
        if (checked) {
            setChecked(true)
        }
    }

    const handleClose = () => {
    setOpen(false);
  };

    return (
        <div>
        <Dialog PaperProps={{ sx: { width: "480px", height:"740px" }}} open={open} onClose={handleClose}>
        <div className='dialog-inner'>
            <DialogContent>
            <div style={{display:"flex", justifyContent:"space-between", alignItems:"flex-start"}}>
                <h2>Оформление заказа</h2>
                <CloseIcon onClick={handleClose} />
                </div>
            <label className='order-label' htmlFor="name">Ваше имя</label>
            <br/>
            <input onChange={handleInputChange} className='order-input' type="text" id='name' name='data.name' placeholder='Например Иван' />
            <br/>
            <label className='order-label'  htmlFor="surname">Ваше фамилия</label>
            <br/>
            <input onChange={handleInputChange} className='order-input' name='data.surname' id='surname' type="text" placeholder='Например Иванов' />
                        <br />
            <div>
            <input pattern="/^[a-zA-Z0-9.!#$%&’*+/=?^_`{|}~-]+@[a-zA-Z0-9-]+(?:\.[a-zA-Z0-9-]+)*$/" onChange={handleInputChange} className='email-input' type="email" id='email' name='data.email' placeholder='example@mail.com' />
            <br />
            <label className='email-label' htmlFor="email">Электронная почта</label>
            </div>
            <br/>
            <label className='order-label'  htmlFor="">Ваш номер телефона</label>
            <br/>
            <PhoneInput international value={phone} onChange={setPhone} defaultCountry="KG" className='phone-input' placeholder="Введите номер телефона"/>
            <br/>
            <label className='order-label'  htmlFor="country">Страна</label>
            <br/>
            <input onChange={handleInputChange} className='order-input' type="text" name='data.country' id='country' placeholder='Страна' />
            <br/>
            <label className='order-label'  htmlFor="city">Город</label>
            <br/>
            <input onChange={(e)=>setCity(e.target.value)} onChange={(e)=>setCity(e.target.value)} className='order-input' type="text" name='city' id='city' placeholder='Город' />
            <br/>
            <input className='order-checkbox' type="checkbox" value={checked} onChange={value} name="checked"  />
            <label htmlFor="checked" className='label'>Согласен с условиями <Link style={{ textDecoration: 'none', color: "#2F80ED", fontSize:"15px" }} to={'/offerta'}>публичной оферты</Link></label>
            {button ? <button onClick={()=>save()} className='active-button'>Заказать</button> : <button className='order-button'>Заказать</button>}
        </DialogContent>
        </div>
      </Dialog>
        </div>
    );
};

export default Order;
